import React from 'react'
import {useAuth0} from '@auth0/auth0-react'

const Logout = () => {
    const { logout, isAuthenticated } = useAuth0();
    const { user } = useAuth0();
    const removeUser = () => {
        localStorage.removeItem(user.nickname)
    }
    return (
        isAuthenticated && (

        <button onClick={() => logout(), removeUser}>
            Logout
        </button>
        )
    )
}

export default Logout
